import React from 'react';
import tour from '../../assets/tourEiffel.jpg';

const Presentation = () => {
  return (
    <div>
        <div>
            <img src={tour} alt="tour Eiffel" />
        </div>
        <div>
            <img src={tour} alt="tour Eiffel" />
        </div>
    </div>
  )
}

export default Presentation;
